import axios from "axios";

const BASE_URL = "http://localhost:5000/api/"
const TOKEN = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyOWE0YTE3NmQxYjUwNDcxNDJkMzJjOCIsImlzUHVibGlzaGVyIjp0cnVlLCJpYXQiOjE2NTQ1Mzg5MDAsImV4cCI6MTY1NDc5ODEwMH0.b6bqwVIaBfeC_39Dm3FRpvH1NiDzpf5YCUKbWWgWDlY"

export const publicRequest = axios.create({
    baseURL: BASE_URL,
});

export default userRequest = axios.create({
    baseURL: BASE_URL,
    header: {token: `Bearer ${TOKEN}`}
})
